import{_ as l,c as i,o as e,a3 as t}from"./chunks/framework.KoSEt7m1.js";const b=JSON.parse('{"title":"coverage-plugin 核心方案设计需求文档","description":"","frontmatter":{},"headers":[],"relativePath":"changelog/coverage-plugin.md","filePath":"changelog/coverage-plugin.md"}'),r={name:"changelog/coverage-plugin.md"};function o(h,a,d,n,u,c){return e(),i("div",null,[...a[0]||(a[0]=[t('<h1 id="coverage-plugin-核心方案设计需求文档" tabindex="-1">coverage-plugin 核心方案设计需求文档 <a class="header-anchor" href="#coverage-plugin-核心方案设计需求文档" aria-label="Permalink to &quot;coverage-plugin 核心方案设计需求文档&quot;">​</a></h1><h2 id="_1-概述" tabindex="-1">1. 概述 <a class="header-anchor" href="#_1-概述" aria-label="Permalink to &quot;1. 概述&quot;">​</a></h2><h3 id="_1-1-目的" tabindex="-1">1.1 目的 <a class="header-anchor" href="#_1-1-目的" aria-label="Permalink to &quot;1.1 目的&quot;">​</a></h3><p>本文档旨在定义 coverage-plugin 工具的需求，该工具目标是在 DevServer 启动时动态插桩，实时收集覆盖率，并与 Git Diff 结合，生成&quot;增量自测报告&quot;。</p><h3 id="_1-2-范围" tabindex="-1">1.2 范围 <a class="header-anchor" href="#_1-2-范围" aria-label="Permalink to &quot;1.2 范围&quot;">​</a></h3><p>本工具将集成到现有的 coverage-plugin 架构中，提供开发阶段的自测覆盖率追踪功能。</p><h2 id="_2-功能需求" tabindex="-1">2. 功能需求 <a class="header-anchor" href="#_2-功能需求" aria-label="Permalink to &quot;2. 功能需求&quot;">​</a></h2><h3 id="_2-1-核心链路架构" tabindex="-1">2.1 核心链路架构 <a class="header-anchor" href="#_2-1-核心链路架构" aria-label="Permalink to &quot;2.1 核心链路架构&quot;">​</a></h3><h4 id="_2-1-1-编译期-compile-time" tabindex="-1">2.1.1 编译期 (Compile Time) <a class="header-anchor" href="#_2-1-1-编译期-compile-time" aria-label="Permalink to &quot;2.1.1 编译期 (Compile Time)&quot;">​</a></h4><ul><li>基于 babel-plugin-istanbul 或原生的 SWC/Esbuild 插件</li><li>在 Webpack/Vite 编译流水线中对代码进行 AST 注入</li></ul><h4 id="_2-1-2-运行时-runtime" tabindex="-1">2.1.2 运行时 (Runtime) <a class="header-anchor" href="#_2-1-2-运行时-runtime" aria-label="Permalink to &quot;2.1.2 运行时 (Runtime)&quot;">​</a></h4><ul><li>在浏览器 window 对象下挂载 <strong>coverage</strong> 对象</li><li>记录每一行、每一个分支的执行状态</li></ul><h4 id="_2-1-3-数据采集-data-collection" tabindex="-1">2.1.3 数据采集 (Data Collection) <a class="header-anchor" href="#_2-1-3-数据采集-data-collection" aria-label="Permalink to &quot;2.1.3 数据采集 (Data Collection)&quot;">​</a></h4><ul><li>开发者完成一次业务流自测后，通过悬浮控制台或快捷键</li><li>将内存中的覆盖率数据发送给本地 Node.js 服务</li></ul><h4 id="_2-1-4-报告映射-mapping-diff" tabindex="-1">2.1.4 报告映射 (Mapping &amp; Diff) <a class="header-anchor" href="#_2-1-4-报告映射-mapping-diff" aria-label="Permalink to &quot;2.1.4 报告映射 (Mapping &amp; Diff)&quot;">​</a></h4><ul><li>工具读取本地 .git 信息</li><li>计算 current-branch 与 master 的 Diff</li><li>过滤出增量代码块，生成&quot;增量自测完成度&quot;仪表盘</li></ul><h3 id="_2-2-关键细节设计" tabindex="-1">2.2 关键细节设计 <a class="header-anchor" href="#_2-2-关键细节设计" aria-label="Permalink to &quot;2.2 关键细节设计&quot;">​</a></h3><h4 id="_2-2-1-动态插桩与性能平衡" tabindex="-1">2.2.1 动态插桩与性能平衡 <a class="header-anchor" href="#_2-2-1-动态插桩与性能平衡" aria-label="Permalink to &quot;2.2.1 动态插桩与性能平衡&quot;">​</a></h4><ul><li>按需插桩：支持配置只对 src/ 下非 node_modules 代码进行插桩</li><li>环境隔离：通过环境变量 ENABLE_SELF_TEST=true 开启，避免生产打包时泄露插桩代码</li></ul><h4 id="_2-2-2-增量代码识别-ast-git" tabindex="-1">2.2.2 增量代码识别 (AST + Git) <a class="header-anchor" href="#_2-2-2-增量代码识别-ast-git" aria-label="Permalink to &quot;2.2.2 增量代码识别 (AST + Git)&quot;">​</a></h4><ul><li>行级 Diff：通过 git diff -U0 获取当前分支改动的行号</li><li>AST 关联：将覆盖率数据中的 statementMap 和 branchMap 位置信息，与 Git Diff 的行号区间进行交集计算</li><li>结果输出： <ul><li>绿色：新增逻辑已跑通</li><li>红色：新增逻辑（如 if 的 else 分支、catch 块）从未进入，这是线上问题的重灾区</li></ul></li></ul><h4 id="_2-2-3-开发者友好-的交互界面-the-overlay" tabindex="-1">2.2.3 &quot;开发者友好&quot;的交互界面 (The Overlay) <a class="header-anchor" href="#_2-2-3-开发者友好-的交互界面-the-overlay" aria-label="Permalink to &quot;2.2.3 &quot;开发者友好&quot;的交互界面 (The Overlay)&quot;">​</a></h4><ul><li>实时进度条：显示当前 Buffer 中的增量覆盖率百分比</li><li>高亮模式：点击开关，直接在当前页面源码上（SourceMap 还原后）高亮未覆盖的逻辑块</li><li>一键导出：生成一个 JSON 或 HTML，作为 MR（合并请求）的强制附件，证明已完成自测</li><li>运行时小气泡：在页面右下角显示一个友好的悬浮气泡，点击后可查看增量代码自测进度，包括： <ul><li>当前页面/组件的覆盖率进度</li><li>未覆盖的代码块列表</li><li>自测建议和提醒</li><li>快捷操作按钮（如导出报告、刷新数据等）</li></ul></li></ul><h3 id="_2-3-增强报告功能" tabindex="-1">2.3 增强报告功能 <a class="header-anchor" href="#_2-3-增强报告功能" aria-label="Permalink to &quot;2.3 增强报告功能&quot;">​</a></h3><h4 id="_2-3-1-开发者信息" tabindex="-1">2.3.1 开发者信息 <a class="header-anchor" href="#_2-3-1-开发者信息" aria-label="Permalink to &quot;2.3.1 开发者信息&quot;">​</a></h4><p>报告应包含以下开发者相关信息：</p><ul><li>Git 用户名 (gitname)</li><li>当前提交哈希 (githash)</li><li>当前分支名称 (current branch)</li><li>硬件信息 (hardware information)</li></ul><h4 id="_2-3-2-测试汇总信息" tabindex="-1">2.3.2 测试汇总信息 <a class="header-anchor" href="#_2-3-2-测试汇总信息" aria-label="Permalink to &quot;2.3.2 测试汇总信息&quot;">​</a></h4><p>报告应包含以下测试汇总信息：</p><ul><li>总测试数量</li><li>通过测试数量</li><li>失败测试数量</li><li>测试通过率</li></ul><h4 id="_2-3-3-代码信息汇总" tabindex="-1">2.3.3 代码信息汇总 <a class="header-anchor" href="#_2-3-3-代码信息汇总" aria-label="Permalink to &quot;2.3.3 代码信息汇总&quot;">​</a></h4><p>报告应包含以下代码相关信息：</p><ul><li>提交代码量</li><li>代码复杂度</li><li>重要代码的重要程度评估</li></ul><h4 id="_2-3-4-业务信息汇总" tabindex="-1">2.3.4 业务信息汇总 <a class="header-anchor" href="#_2-3-4-业务信息汇总" aria-label="Permalink to &quot;2.3.4 业务信息汇总&quot;">​</a></h4><p>报告应包含以下业务相关信息，以表格形式展示：</p><ul><li>页面名称</li><li>组件名称</li><li>编写代码行数</li><li>自测总数</li><li>自测通过数</li><li>严重等级（用于判断是否放行）</li><li>影响范围分析： <ul><li>受影响的页面列表</li><li>受影响的组件列表</li><li>影响程度评估（高/中/低）</li><li>影响传播路径分析</li><li>回归测试建议</li></ul></li></ul><h2 id="_3-技术实现路线" tabindex="-1">3. 技术实现路线 <a class="header-anchor" href="#_3-技术实现路线" aria-label="Permalink to &quot;3. 技术实现路线&quot;">​</a></h2><h3 id="_3-1-第一阶段-数据捕获-the-collector" tabindex="-1">3.1 第一阶段：数据捕获 (The Collector) <a class="header-anchor" href="#_3-1-第一阶段-数据捕获-the-collector" aria-label="Permalink to &quot;3.1 第一阶段：数据捕获 (The Collector)&quot;">​</a></h3><ul><li>利用 babel-plugin-istanbul 实现核心逻辑</li><li>支持 JavaScript、TypeScript 等文件类型</li><li>可选：结合 Git 仅对当前变动的文件进行插桩以提升速度</li><li>收集开发者环境信息（Git信息、硬件信息等）</li><li>分析代码依赖关系，识别潜在的影响范围</li></ul><h3 id="_3-2-第二阶段-本地报告服务-the-local-server" tabindex="-1">3.2 第二阶段：本地报告服务 (The Local Server) <a class="header-anchor" href="#_3-2-第二阶段-本地报告服务-the-local-server" aria-label="Permalink to &quot;3.2 第二阶段：本地报告服务 (The Local Server)&quot;">​</a></h3><ul><li>在 Webpack 插件的 apply 方法中，利用 devServer.before 拦截 API</li><li>POST /__coverage_upload：接收浏览器发回的覆盖率数据</li><li>调用 istanbul-reports 生成 HTML，并自动对比 Git Diff</li><li>生成增强版报告，包含开发者信息、测试汇总、代码信息和业务信息</li><li>注入运行时小气泡 UI 组件到页面中，实时显示覆盖率进度</li><li>基于代码依赖分析生成影响范围报告</li></ul><h3 id="_3-3-第三阶段-门禁集成-the-gatekeeper" tabindex="-1">3.3 第三阶段：门禁集成 (The Gatekeeper) <a class="header-anchor" href="#_3-3-第三阶段-门禁集成-the-gatekeeper" aria-label="Permalink to &quot;3.3 第三阶段：门禁集成 (The Gatekeeper)&quot;">​</a></h3><ul><li>在 specs 规范中增加一条：&quot;无自测报告，不准提交&quot;</li><li>使用 husky 在 pre-commit 阶段检查本地是否存在符合标准的自测覆盖率数据</li><li>增量分支覆盖率 &gt; 80% 作为最低要求</li><li>基于报告中的严重等级判断是否放行代码提交</li></ul><h2 id="_4-非功能需求" tabindex="-1">4. 非功能需求 <a class="header-anchor" href="#_4-非功能需求" aria-label="Permalink to &quot;4. 非功能需求&quot;">​</a></h2><h3 id="_4-1-性能要求" tabindex="-1">4.1 性能要求 <a class="header-anchor" href="#_4-1-性能要求" aria-label="Permalink to &quot;4.1 性能要求&quot;">​</a></h3><ul><li>不影响本地开发 HMR（热更新）速度</li><li>插桩代码在生产环境中不可见</li></ul><h3 id="_4-2-兼容性要求" tabindex="-1">4.2 兼容性要求 <a class="header-anchor" href="#_4-2-兼容性要求" aria-label="Permalink to &quot;4.2 兼容性要求&quot;">​</a></h3><ul><li>支持 Webpack 和 Vite 构建工具</li><li>支持主流浏览器</li></ul><h3 id="_4-3-安全性要求" tabindex="-1">4.3 安全性要求 <a class="header-anchor" href="#_4-3-安全性要求" aria-label="Permalink to &quot;4.3 安全性要求&quot;">​</a></h3><ul><li>确保覆盖率数据仅在本地环境中传输和存储</li><li>避免敏感信息泄露</li></ul><h2 id="_5-验收标准" tabindex="-1">5. 验收标准 <a class="header-anchor" href="#_5-验收标准" aria-label="Permalink to &quot;5. 验收标准&quot;">​</a></h2><h3 id="_5-1-功能验收标准" tabindex="-1">5.1 功能验收标准 <a class="header-anchor" href="#_5-1-功能验收标准" aria-label="Permalink to &quot;5.1 功能验收标准&quot;">​</a></h3><ul><li>能够正确插桩并收集覆盖率数据</li><li>能够准确识别增量代码并生成报告</li><li>提供友好的开发者交互界面</li><li>集成到 Git 提交门禁流程</li><li>生成包含开发者信息、测试汇总、代码信息和业务信息的增强版报告</li><li>在页面中显示运行时小气泡，实时显示覆盖率进度</li><li>生成影响范围分析报告，包含受影响的页面和组件列表</li></ul><h3 id="_5-2-功能详细要求" tabindex="-1">5.2 功能详细要求 <a class="header-anchor" href="#_5-2-功能详细要求" aria-label="Permalink to &quot;5.2 功能详细要求&quot;">​</a></h3><h4 id="_5-2-1-报告内容要求" tabindex="-1">5.2.1 报告内容要求 <a class="header-anchor" href="#_5-2-1-报告内容要求" aria-label="Permalink to &quot;5.2.1 报告内容要求&quot;">​</a></h4><h5 id="开发者信息部分" tabindex="-1">开发者信息部分 <a class="header-anchor" href="#开发者信息部分" aria-label="Permalink to &quot;开发者信息部分&quot;">​</a></h5><ul><li>Git 用户名：通过 <code>git config user.name</code> 获取</li><li>当前提交哈希：通过 <code>git rev-parse HEAD</code> 获取</li><li>当前分支名称：通过 <code>git branch --show-current</code> 获取</li><li>硬件信息：包括操作系统、CPU 核心数、内存大小等</li></ul><h5 id="测试汇总部分" tabindex="-1">测试汇总部分 <a class="header-anchor" href="#测试汇总部分" aria-label="Permalink to &quot;测试汇总部分&quot;">​</a></h5><ul><li>总测试数量：统计所有执行的测试用例数量</li><li>通过测试数量：统计成功执行的测试用例数量</li><li>失败测试数量：统计执行失败的测试用例数量</li><li>测试通过率：计算通过测试占总测试的比例</li></ul><h5 id="代码信息部分" tabindex="-1">代码信息部分 <a class="header-anchor" href="#代码信息部分" aria-label="Permalink to &quot;代码信息部分&quot;">​</a></h5><ul><li>提交代码量：统计本次提交涉及的代码行数</li><li>代码复杂度：基于圈复杂度等指标评估代码复杂度</li><li>重要代码重要程度：根据代码位置、调用频率等因素评估重要程度</li></ul><h5 id="业务信息部分" tabindex="-1">业务信息部分 <a class="header-anchor" href="#业务信息部分" aria-label="Permalink to &quot;业务信息部分&quot;">​</a></h5><ul><li>页面名称：涉及的前端页面名称</li><li>组件名称：涉及的组件名称</li><li>编写代码行数：每个组件/页面的代码行数统计</li><li>自测总数：针对每个组件/页面执行的自测用例数量</li><li>自测通过数：针对每个组件/页面成功执行的自测用例数量</li><li>严重等级：根据代码重要性和测试覆盖率评估严重等级（高/中/低）</li><li>影响范围分析： <ul><li>受影响的页面列表：列出受本次代码变更影响的所有页面</li><li>受影响的组件列表：列出受本次代码变更影响的所有组件</li><li>影响程度评估：根据依赖关系和调用频率评估影响程度（高/中/低）</li><li>影响传播路径分析：展示代码变更如何传播到其他组件或页面</li><li>回归测试建议：基于影响范围提供回归测试的优先级建议</li></ul></li></ul><h4 id="_5-2-2-报告格式要求" tabindex="-1">5.2.2 报告格式要求 <a class="header-anchor" href="#_5-2-2-报告格式要求" aria-label="Permalink to &quot;5.2.2 报告格式要求&quot;">​</a></h4><ul><li>支持 HTML 和 Markdown 双格式输出</li><li>HTML 格式应具有良好的可视化效果和交互性，包含以下图表元素： <ul><li>饼图：展示测试通过率分布</li><li>柱状图：展示各组件/页面的代码行数和测试覆盖率</li><li>进度条：直观显示整体测试进度</li><li>热力图：展示代码复杂度分布</li></ul></li><li>Markdown 格式应结构清晰，便于版本控制和文档管理</li><li>业务信息部分应以表格形式展示，便于阅读和分析</li></ul><h4 id="_5-2-3-报告生成要求" tabindex="-1">5.2.3 报告生成要求 <a class="header-anchor" href="#_5-2-3-报告生成要求" aria-label="Permalink to &quot;5.2.3 报告生成要求&quot;">​</a></h4><ul><li>报告应在每次构建完成后自动生成</li><li>报告生成时间不应超过 5 秒</li><li>报告应保存在指定目录下，支持自定义路径配置</li></ul><h4 id="_5-2-4-运行时小气泡要求" tabindex="-1">5.2.4 运行时小气泡要求 <a class="header-anchor" href="#_5-2-4-运行时小气泡要求" aria-label="Permalink to &quot;5.2.4 运行时小气泡要求&quot;">​</a></h4><ul><li>在页面右下角显示悬浮气泡，不遮挡页面内容</li><li>气泡应包含以下信息： <ul><li>当前页面/组件的覆盖率百分比</li><li>未覆盖的代码块数量</li><li>自测进度状态（如：进行中、已完成、需改进）</li></ul></li><li>点击气泡后展开详细信息面板，显示： <ul><li>详细的覆盖率统计数据</li><li>未覆盖的代码块列表</li><li>自测建议和提醒</li><li>快捷操作按钮（导出报告、刷新数据等）</li></ul></li><li>气泡应支持拖拽移动，方便开发者调整位置</li><li>气泡应支持最小化/隐藏，避免干扰正常开发</li><li>气泡样式应与主流设计风格保持一致，美观且不突兀</li></ul><h3 id="_5-3-性能验收标准" tabindex="-1">5.3 性能验收标准 <a class="header-anchor" href="#_5-3-性能验收标准" aria-label="Permalink to &quot;5.3 性能验收标准&quot;">​</a></h3><ul><li>HMR 热更新延迟增加不超过 10%</li><li>内存占用合理，不影响开发体验</li><li>报告生成时间不超过 5 秒</li></ul><h3 id="_5-4-部署验收标准" tabindex="-1">5.4 部署验收标准 <a class="header-anchor" href="#_5-4-部署验收标准" aria-label="Permalink to &quot;5.4 部署验收标准&quot;">​</a></h3><ul><li>易于集成到现有项目中</li><li>提供清晰的配置文档</li><li>报告格式支持 HTML 和 Markdown 双格式</li></ul><h2 id="_6-配置选项" tabindex="-1">6. 配置选项 <a class="header-anchor" href="#_6-配置选项" aria-label="Permalink to &quot;6. 配置选项&quot;">​</a></h2><h3 id="_6-1-基础配置" tabindex="-1">6.1 基础配置 <a class="header-anchor" href="#_6-1-基础配置" aria-label="Permalink to &quot;6.1 基础配置&quot;">​</a></h3><table tabindex="0"><thead><tr><th>选项</th><th>类型</th><th>默认值</th><th>描述</th></tr></thead><tbody><tr><td>enabled</td><td>boolean</td><td><code>process.env.ENABLE_SELF_TEST === &#39;true&#39;</code></td><td>是否启用插件</td></tr><tr><td>include</td><td>RegExp | string[]</td><td><code>[]</code></td><td>需要插桩的文件模式</td></tr><tr><td>exclude</td><td>RegExp | string[]</td><td><code>[/node_modules/, /\\.test\\./, /\\.spec\\./]</code></td><td>需要排除的文件模式</td></tr><tr><td>outputDir</td><td>string</td><td><code>&#39;.coverage&#39;</code></td><td>输出目录</td></tr></tbody></table><h3 id="_6-2-增强配置" tabindex="-1">6.2 增强配置 <a class="header-anchor" href="#_6-2-增强配置" aria-label="Permalink to &quot;6.2 增强配置&quot;">​</a></h3><table tabindex="0"><thead><tr><th>选项</th><th>类型</th><th>默认值</th><th>描述</th></tr></thead><tbody><tr><td>enableImpactAnalysis</td><td>boolean</td><td><code>true</code></td><td>是否启用影响范围分析</td></tr><tr><td>enableOverlay</td><td>boolean</td><td><code>true</code></td><td>是否启用运行时小气泡</td></tr><tr><td>threshold</td><td>number</td><td><code>80</code></td><td>增量覆盖率阈值 (%)</td></tr><tr><td>autoResetCoverage</td><td>boolean</td><td><code>false</code></td><td>是否与其他插件联动自动重置覆盖率</td></tr></tbody></table><h3 id="_6-3-联动配置" tabindex="-1">6.3 联动配置 <a class="header-anchor" href="#_6-3-联动配置" aria-label="Permalink to &quot;6.3 联动配置&quot;">​</a></h3><table tabindex="0"><thead><tr><th>选项</th><th>类型</th><th>默认值</th><th>描述</th></tr></thead><tbody><tr><td>apiTracker</td><td>object</td><td><code>{ enable: false }</code></td><td>与API追踪插件的联动配置</td></tr><tr><td>apiTracker.enable</td><td>boolean</td><td><code>false</code></td><td>是否启用API追踪联动</td></tr><tr><td>apiTracker.snapshotPath</td><td>string</td><td><code>&#39;./.api-tracker/api-snapshot.json&#39;</code></td><td>API快照文件路径</td></tr><tr><td>apiTracker.onApiChange</td><td>string</td><td><code>&#39;warn&#39;</code></td><td>API变更时的行为 (&#39;reset&#39; | &#39;warn&#39;)</td></tr></tbody></table><h2 id="_7-与其他插件的协同" tabindex="-1">7. 与其他插件的协同 <a class="header-anchor" href="#_7-与其他插件的协同" aria-label="Permalink to &quot;7. 与其他插件的协同&quot;">​</a></h2><h3 id="_7-1-独立运行模式" tabindex="-1">7.1 独立运行模式 <a class="header-anchor" href="#_7-1-独立运行模式" aria-label="Permalink to &quot;7.1 独立运行模式&quot;">​</a></h3><p>coverage-plugin 可以独立运行，不依赖其他插件，提供完整的覆盖率收集和报告生成功能。</p><h3 id="_7-2-联动运行模式" tabindex="-1">7.2 联动运行模式 <a class="header-anchor" href="#_7-2-联动运行模式" aria-label="Permalink to &quot;7.2 联动运行模式&quot;">​</a></h3><p>当与 api-tracker-plugin 配合使用时，可以通过配置实现以下功能：</p><ul><li>接收API变更通知</li><li>自动重置受影响文件的覆盖率数据</li><li>在报告中显示API变更影响</li></ul><h2 id="_8-安全与隐私" tabindex="-1">8. 安全与隐私 <a class="header-anchor" href="#_8-安全与隐私" aria-label="Permalink to &quot;8. 安全与隐私&quot;">​</a></h2><h3 id="_8-1-数据存储" tabindex="-1">8.1 数据存储 <a class="header-anchor" href="#_8-1-数据存储" aria-label="Permalink to &quot;8.1 数据存储&quot;">​</a></h3><ul><li>所有覆盖率数据仅在本地存储</li><li>不会上传到任何远程服务器</li><li>生成的报告仅保存在本地文件系统中</li></ul><h3 id="_8-2-敏感信息处理" tabindex="-1">8.2 敏感信息处理 <a class="header-anchor" href="#_8-2-敏感信息处理" aria-label="Permalink to &quot;8.2 敏感信息处理&quot;">​</a></h3><ul><li>不会收集或存储任何个人身份信息</li><li>Git信息仅用于报告标识，不会外传</li><li>硬件信息仅用于环境标识，不会外传</li></ul><h2 id="_9-文档要求" tabindex="-1">9. 文档要求 <a class="header-anchor" href="#_9-文档要求" aria-label="Permalink to &quot;9. 文档要求&quot;">​</a></h2><h3 id="_9-1-readme-文档" tabindex="-1">9.1 README 文档 <a class="header-anchor" href="#_9-1-readme-文档" aria-label="Permalink to &quot;9.1 README 文档&quot;">​</a></h3><ul><li>提供项目概述和核心功能介绍</li><li>包含安装和使用指南</li><li>提供详细的 API 文档和使用示例</li><li>包含贡献指南和许可证信息</li></ul><h3 id="_9-2-api-文档" tabindex="-1">9.2 API 文档 <a class="header-anchor" href="#_9-2-api-文档" aria-label="Permalink to &quot;9.2 API 文档&quot;">​</a></h3><ul><li>为插件配置选项提供详细的说明文档</li><li>包含使用示例和配置选项说明</li><li>提供 Webpack 集成指南</li><li>支持 TypeScript 类型提示</li></ul><h3 id="_9-3-使用示例" tabindex="-1">9.3 使用示例 <a class="header-anchor" href="#_9-3-使用示例" aria-label="Permalink to &quot;9.3 使用示例&quot;">​</a></h3><ul><li>提供完整的 Webpack 配置使用示例</li><li>包含常见场景的解决方案</li><li>提供最佳实践指导</li><li>包含错误处理示例</li></ul><h3 id="_9-4-更新日志" tabindex="-1">9.4 更新日志 <a class="header-anchor" href="#_9-4-更新日志" aria-label="Permalink to &quot;9.4 更新日志&quot;">​</a></h3><ul><li>遵循标准的 CHANGELOG 格式</li><li>记录每个版本的功能新增、bug修复和破坏性变更</li><li>提供升级指南和兼容性说明</li></ul><h2 id="_10-发布和版本管理" tabindex="-1">10. 发布和版本管理 <a class="header-anchor" href="#_10-发布和版本管理" aria-label="Permalink to &quot;10. 发布和版本管理&quot;">​</a></h2><h3 id="_10-1-版本规范" tabindex="-1">10.1 版本规范 <a class="header-anchor" href="#_10-1-版本规范" aria-label="Permalink to &quot;10.1 版本规范&quot;">​</a></h3><ul><li>遵循语义化版本规范（SemVer）</li><li>主版本号：不兼容的API修改</li><li>次版本号：向下兼容的功能性新增</li><li>修订号：向下兼容的问题修正</li></ul><h3 id="_10-2-发布流程" tabindex="-1">10.2 发布流程 <a class="header-anchor" href="#_10-2-发布流程" aria-label="Permalink to &quot;10.2 发布流程&quot;">​</a></h3><ul><li>自动化测试通过后才能发布</li><li>发布前进行代码审查</li><li>确保文档和示例代码更新完毕</li><li>提供详细的更新日志</li></ul><h3 id="_10-3-npm-包管理" tabindex="-1">10.3 npm 包管理 <a class="header-anchor" href="#_10-3-npm-包管理" aria-label="Permalink to &quot;10.3 npm 包管理&quot;">​</a></h3><ul><li>发布到 npm 公共仓库 (@51jbs/coverage-plugin)</li><li>支持 CDN 引入 (unpkg, jsDelivr)</li><li>提供 UMD、ES Module、CommonJS 等多种格式</li><li>包含完整的类型定义文件 (index.d.ts)</li><li>支持 tree-shaking 优化</li><li>提供 package.json 元数据（keywords, homepage, repository, bugs等）</li></ul>',107)])])}const _=l(r,[["render",o]]);export{b as __pageData,_ as default};
